Description:
Esta noche tiene lugar la final del reality por excelencia de este verano, Superbibientes: &quot;Empalmados en Honduras&quot;. Hoy sabremos si el ganador de esta edicion es Tony Gemir, Rosa de Pepino o Tetona Monroi. Pero solo vosotros fieles espectadores de Cumlouder sabreis que paso con los primeros concursantes del programa a los que se dio por desaparecidos una hora despues de que el helicoptero les dejara en la isla de Cono Paloma
